// src/components/Contact/Contact.js
import React from "react";
import "./Contact.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedin, faGithub, faUpwork } from '@fortawesome/free-brands-svg-icons';

function Contact() {
  return (
    <section id="contact" className="contact">
      <h2>Contact Me</h2>
      <form className="contact-form">
        <input type="text" placeholder="Name" required />
        <input type="email" placeholder="Email" required />
        <textarea placeholder="Message" required></textarea>
        <button type="submit">Send</button>
      </form>
      <div className="contact-icons">
        
      <a href="www.linkedin.com/in/shams-alwadiya"></a>
      <i class="fa-brands fa-upwork"><a href="https://www.upwork.com/freelancers/~017d8a92816b0bd6b9"></a></i>
      <i class="fa-solid fa-envelope"><a href="mailto:shams32002@gmail.com"></a></i> 
      <i class="fa-brands fa-github"><a href="https://github.com/shamsAlwadiya"></a></i>     </div>
    </section>
  );
}

export default Contact;
